import Footer from "./Footer";
import Navbar from "./Navbar";

export default function Layout({children}){
    return(
        <>
        <div>
         <div className="layout">
      <Navbar />
      <main className="layout-main">
        <Outlet />
      </main>
      <Footer />
    </div>   
        </div>
        <Navbar/>
        <main style={{minHeight:"50vh"}}>{children}</main>
        <Footer/>
        </>
    )
}
